D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_%D0%B2_%D0%9D%D0%B8%D0%B6%D0%BD%D0%B5%D0%BC_%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B5_(1896)\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 \u0432 \u041d\u0438\u0436\u043d\u0435\u043c \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0435 (1896)\">\u041d\u0438\u0436\u0435\u0433\u043e\u0440\u043e\u0434\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430<\/a>. \u041e\u0434\u043d\u0438\u043c \u0438\u0437 \u043f\u0440\u0430\u0437\u0434\u043d\u0438\u0447\u043d\u044b\u0445 \u043c\u0435\u0440\u043e\u043f\u0440\u0438\u044f\u0442\u0438\u0439 \u0441\u0442\u0430\u043b\u0430 \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u043a\u0430 \u0432 \u0414\u0435\u0440\u0435\u0432\u044f\u043d\u043d\u043e\u043c \u043e\u043f\u0435\u0440\u043d\u043e\u043c \u0442\u0435\u0430\u0442\u0440\u0435 \u043e\u043f\u0435\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BB%D0%B8%D0%BD%D0%BA%D0%B0,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0413\u043b\u0438\u043d\u043a\u0430, \u041c\u0438\u0445\u0430\u0438\u043b \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0413\u043b\u0438\u043d\u043a\u0438<\/a> \u00ab\u0416\u0438\u0437\u043d\u044c \u0437\u0430 \u0446\u0430\u0440\u044f\u00bb. \u042d\u0442\u043e \u0431\u044b\u043b\u043e \u0432\u0442\u043e\u0440\u043e\u0435 \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u0435 \u0427\u0430\u0441\u0442\u043d\u043e\u0439 \u043e\u043f\u0435\u0440\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BC%D0%BE%D0%BD%D1%82%D0%BE%D0%B2,_%D0%A1%D0%B0%D0%B2%D0%B2%D0%B0_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041c\u0430\u043c\u043e\u043d\u0442\u043e\u0432, \u0421\u0430\u0432\u0432\u0430 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0421\u0430\u0432\u0432\u044b \u041c\u0430\u043c\u043e\u043d\u0442\u043e\u0432\u0430<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u0438\u0433\u043b\u0430\u0441\u0438\u043b \u043d\u0430 \u0433\u043b\u0430\u0432\u043d\u0443\u044e \u0440\u043e\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BB%D1%8F%D0%BF%D0%B8%D0%BD,_%D0%A4%D1%91%D0%B4%D0%BE%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0428\u0430\u043b\u044f\u043f\u0438\u043d, \u0424\u0451\u0434\u043e\u0440 \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0424\u0451\u0434\u043e\u0440\u0430 \u0428\u0430\u043b\u044f\u043f\u0438\u043d\u0430<\/a>. 23-\u043b\u0435\u0442\u043d\u0438\u0439 \u043f\u0435\u0432\u0435\u0446 \u0431\u044b\u043b \u043a \u044d\u0442\u043e\u043c\u0443 \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0443\u0436\u0435 \u0437\u0430\u0447\u0438\u0441\u043b\u0435\u043d \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80\" title=\"\u041c\u0430\u0440\u0438\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440\">\u041c\u0430\u0440\u0438\u0438\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440<\/a>, \u043d\u043e \u0441\u0443\u0434\u044c\u0431\u043e\u043d\u043e\u0441\u043d\u044b\u043c \u0441\u0442\u0430\u043b\u043e \u0434\u043b\u044f \u043d\u0435\u0433\u043e \u0438\u043c\u0435\u043d\u043d\u043e \u0441\u043e\u0442\u0440\u0443\u0434\u043d\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0441 \u041c\u0430\u043c\u043e\u043d\u0442\u043e\u0432\u044b\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1900\" class=\"mw-redirect\" title=\"1900\">1900<\/a>&#160;\u2014 \u043d\u0430 \u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\u0441\u043a\u0438\u0445 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u0431\u044b\u043b\u0430 \u0438\u0441\u043f\u0440\u043e\u0431\u043e\u0432\u0430\u043d\u0430 \u0441\u0438\u0441\u0442\u0435\u043c\u0430 \u043f\u0440\u043e\u043f\u043e\u0440\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905\" class=\"mw-redirect\" title=\"1905\">1905<\/a>&#160;\u2014 \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D1%83%D1%81%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%80%D0%B0%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0426\u0443\u0441\u0438\u043c\u0441\u043a\u043e\u0435 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435\">\u0426\u0443\u0441\u0438\u043c\u0441\u043a\u043e\u0433\u043e \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913\" class=\"mw-redirect\" title=\"1913\">1913<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" class=\"mw-redirect\" title=\"\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043f\u0435\u0440\u0432\u044b\u0439 \u0432 \u043c\u0438\u0440\u0435 \u0447\u0435\u0442\u044b\u0440\u0451\u0445\u043c\u043e\u0442\u043e\u0440\u043d\u044b\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B2%D0%B8%D1%82%D1%8F%D0%B7%D1%8C_(%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82)\" title=\"\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0432\u0438\u0442\u044f\u0437\u044c (\u0441\u0430\u043c\u043e\u043b\u0451\u0442)\">\u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0432\u0438\u0442\u044f\u0437\u044c<\/a>\u00bb \u043a\u043e\u043d\u0441\u0442\u0440\u0443\u043a\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B8%D0%BA%D0%BE%D1%80%D1%81%D0%BA%D0%B8%D0%B9,_%D0%98%D0%B3%D0%BE%D1%80%D1%8C_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u0438\u0439, \u0418\u0433\u043e\u0440\u044c \u0418\u0432\u0430\u043d\u043e\u0432\u0438\u0447\">\u0421\u0438\u043a\u043e\u0440\u0441\u043a\u043e\u0433\u043e<\/a> \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u043f\u0440\u043e\u0448\u0451\u043b \u043f\u0435\u0440\u0432\u044b\u0435 \u0438\u0441\u043f\u044b\u0442\u0430\u043d\u0438\u044f \u0432 \u043f\u043e\u043b\u0451\u0442\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916\" class=\"mw-redirect\" title=\"1916\">1916<\/a>&#160;\u2014 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D1%81%D0%BE%D0%BD,_%D0%92%D1%83%D0%B4%D1%80%D0%BE\" title=\"\u0412\u0438\u043b\u044c\u0441\u043e\u043d, \u0412\u0443\u0434\u0440\u043e\">\u0412\u0443\u0434\u0440\u043e \u0412\u0438\u043b\u044c\u0441\u043e\u043d<\/a> \u043f\u0440\u0438\u0437\u0432\u0430\u043b \u043f\u043e\u0441\u043b\u0435 \u0432\u043e\u0439\u043d\u044b \u0441\u043e\u0437\u0434\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041b\u0438\u0433\u0430 \u041d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0443 \u041d\u0430\u0446\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920\" class=\"mw-redirect\" title=\"1920\">1920<\/a>&#160;\u2014 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D1%82%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" ti